import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './components/home';
import Footer from './components/footer';
import RegistrationForm from './components/Login_Registration/RegistrationForm';
import LoginForm from './components/Login_Registration/Login'; // Import the LoginForm component

function App() {
  return (
    <Router>
      <div className="min-h-screen flex flex-col flex-1">
        <Navbar />
        <main className="flex-1">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/register" element={<RegistrationForm />} />
            <Route path="/login" element={<LoginForm />} /> {/* Add route for login */}
            {/* Add more routes here if needed */}
          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
